# 2, 2, 512, 512
	# Run the Tetris game.
main:
	li $t0, 0
	sw $t0, point
	j display_home
	j bg_2
	# j bg
	
bg_2:
	lw $t0, ADDR_DSPL
	la $a0, new_game_display

	li $s0, 0
	j loop_new_game
	
loop_new_game:
	 bge $s0, 4096, start_game #exit #start_game
	 addi $s0, $s0, 1
	 
	 lw $t1, 0($a0)
	 sw $t1, 0($t0)
	 addi $t0, $t0, 4
	 addi $a0, $a0, 4
	 b loop_new_game
	
display_home:
	li $t0, 1
	sw $t0, for_home
	lw $s0, ADDR_KBRD 
	la $t7, home_display
	li $t6, 0
	lw $t8, ADDR_DSPL
loop_home:
	bge $t6, 4096, full_home_display
	lw $t9, 0($t7)
	sw $t9, 0($t8)
	addi $t6, $t6, 1
	addi $t7, $t7, 4
	addi $t8, $t8, 4
	b loop_home

display_home_2:
	li $t0, 0
	sw $t0, for_home
	lw $s0, ADDR_KBRD 
	la $t7, home_display_2
	li $t6, 0
	lw $t8, ADDR_DSPL
loop_home_2:
	bge $t6, 4096, full_home_display
	lw $t9, 0($t7)
	sw $t9, 0($t8)
	addi $t6, $t6, 1
	addi $t7, $t7, 4
	addi $t8, $t8, 4
	b loop_home_2
back:
	j start_game

	j exit
	
go_home_display:
	li $v0, 32
	li $a0, 500
	syscall
	lw $t7, for_home
	beq $t7, 0, display_home
	beq $t7, 1, display_home_2
	
full_home_display:
	lw $s0, ADDR_KBRD
	lw $s1, 0($s0)
	beq $s1, 0, go_home_display
	li $t0, 0
	sw $t0, 0($s0)
	b bg_2
# next block + 4
# next row + 256
start_game:	
	
	li $t0, 0
	sw $t0, rotation
	
	# Randomize the piece spawn location
	
	j clear_tetris

	
finish_check:
	move $s0, $t6	
	j re_paint
	
