	beq $s0, 0, skip_point
	addi $t0, $t0, 100
	beq $s0, 1, skip_point
	addi $t0, $t0, 200
	beq $s0, 2, skip_point
	addi $t0, $t0, 200
	beq $s0, 3, skip_point
	addi $t0, $t0, 300
	

