exit:
	li $v0, 10
	syscall
	
exit_loop:	
	la $t0, exit_display
	li $t1, 0
	lw $t2, ADDR_DSPL
	
game_over_loop:
	lw $t3, 0 ($t0)
	beq $t3, 0x00000000, update
	sw $t3, 0($t2)
	
update: addi $t0, $t0, 4
	addi $t2, $t2, 4
	addi $t1, $t1, 1
	bne $t1, 4096, game_over_loop
exit_check_2:
	li $v0, 32
	li $a0, 500
	syscall
	
	lw $t0, ADDR_KBRD
	lw $a0, 0($t0)
	
	beq $a0, 0, exit_check_2
	lw $a0, 4($t0)
	beq $a0, 0x72, main
    	beq $a0, 0x71, exit
	j exit_check_2
	
check_bound:
	lw $t0, spawn_bound
	
	addi $t0, $t0, 1
	sw $t0, spawn_bound
	bne $t0, 8, start_game
	li $v0, 32
	li $a0, 500
	syscall
	
	b exit_loop 
	
# take 4 arguments, address, colour 1, colour 2, colour 3
build_block:
	lw $t0, -4($sp) # take address
	
	lw $t1, -8($sp) # take colour 1
	
	lw $t2, -12($sp) # take colour 2
	
	lw $t3, -16($sp) # take colour 3
	
	sw $t1, 0($t0)
	sw $t1, 8($t0)
	#sw $t1, 260($t0)
	sw $t1, 512($t0)
	sw $t1, 520($t0)
	sw $t3, 4($t0)
	sw $t3, 264($t0)
	sw $t3, 256($t0)
	sw $t3, 516($t0)
	#li $t1, 0xffffff
	sw $t2, 260($t0)
	jr $ra 
	
restore: # for delete purpose, take one argument, address to restore
	lw $s0, -4($sp) # load purpose
	lw $t0, -20($sp) # load colour
		
	sw $t0, 0($s0)
	sw $t0, 4($s0)
	sw $t0, 8($s0)
	sw $t0, 256($s0)
	sw $t0, 260($s0)
	sw $t0, 264($s0)
	sw $t0, 512($s0)
	sw $t0, 516($s0)
	sw $t0, 520($s0)
	jr $ra
