	lw $a0, 0($t0)
	beq $a0, 1, keyboard_input_shape_7

	beq $a0, 0, delay_shape_7
	b keyboard_shape_7
	
delay_shape_7:
	lw $t0, store_down
	bne $t0, 30000, loop_delay_shape_7
	
	li $t0, 0
	sw $t0, store_down
	# j keyboard_shape_2
	j respond_to_S_shape_7

loop_delay_shape_7:
	addi $t0, $t0, 1
	sw $t0, store_down
	j keyboard_shape_7

keyboard_input_shape_7:
	lw $a0, 4($t0)                  	# Load second word from keyboard
    	beq $a0, 0x70, P_shape_7
    	j skip_P_shape_7
P_shape_7:
	jal respond_to_P_1
skip_P_shape_7:
    	beq $a0, 0x64, respond_to_D_shape_7 # Check if the key q was pressed
    	beq $a0, 0x61, respond_to_A_shape_7
    	beq $a0, 0x77, respond_to_W_shape_7
    	beq $a0, 0x73, respond_to_S_shape_7
