spawn_shape_6: #shape j
	lw $s4, -4($sp)
	blt $s4, 1, start_game
	bge $s4, 9, start_game
	mul $s4, $s4, 12
	
	lw $s5, start_spawn
	add $s4, $s4, $s5
	
	lw $s5, gv_1
	sw $s5, -8($sp)
	
	lw $s5, gv_2
	sw $s5, -12($sp)
	
	lw $s5, gv_3
	sw $s5, -16($sp)
	
	jal check_spawn_6
	
	li $t8, 0
	sw $t8, rotation
	sw $t8, spawn_bound
	
	sw $s4, -4($sp)
	jal build_block
	
	addi $s4, $s4, 12
	sw $s4, -4($sp)
	jal build_block
	
	addi $s4, $s4, -24
	sw $s4, -4($sp)
	jal build_block
	
	addi $s4, $s4, -768
	sw $s4, -4($sp)
	jal build_block
	
	addi $s4, $s4, 780
	sw $s4, -4($sp)
	b keyboard_shape_6
	
check_spawn_6:
	lw $t7, 0($s4)
	lw $t8, orange_0
	
	bne $t7, $t8, check_spawn_6_1
	
	lw $t7, -780($s4)
	bne $t7, $t8, check_bound
	
	lw $t8, orange_1
	lw $t7, -12($s4)
	bne $t8, $t7, check_bound
	
	lw $t7, 12($s4)
	bne $t8, $t7, check_bound
	
	jr $ra
check_spawn_6_1:
	lw $t7, 12($s4)
	
	bne $t7, $t8, check_bound
	
	lw $t7, -12($s4)
	bne $t7, $t8, check_bound
	
	lw $t8, orange_1
	lw $t7, 0($s4)
	bne $t8, $t7, check_bound
	
	lw $t7, -780($s4)
	bne $t8, $t7, check_bound
	
	jr $ra


keyboard_shape_6:
	
	lw $t0, ADDR_KBRD
	lw $a0, 0($t0)
	beq $a0, 1, keyboard_input_shape_6
	
	beq $a0, 0, delay_shape_6
	b keyboard_shape_6
	
delay_shape_6:
	lw $t0, store_down
	bne $t0, 30000, loop_delay_shape_6
	
	li $t0, 0
	sw $t0, store_down
	# j keyboard_shape_2
	j respond_to_S_shape_6

loop_delay_shape_6:
	addi $t0, $t0, 1
	sw $t0, store_down
	j keyboard_shape_6

keyboard_input_shape_6:
	lw $a0, 4($t0)                  	# Load second word from keyboard
    	beq $a0, 0x70, P_shape_6
    	j skip_P_shape_6
P_shape_6:
	jal respond_to_P_1
skip_P_shape_6:
    	beq $a0, 0x64, respond_to_D_shape_6 # Check if the key q was pressed
    	beq $a0, 0x61, respond_to_A_shape_6
    	beq $a0, 0x77, respond_to_W_shape_6
    	beq $a0, 0x73, respond_to_S_shape_6
    	beq $a0, 0x72, main
    	beq $a0, 0x71, exit
	b keyboard_shape_6

respond_to_S_shape_6:
	lw $t0, rotation
	beq $t0, 0, S_0_shape_6
	beq $t0, 1, S_1_shape_6
	beq $t0, 2, S_2_shape_6
	beq $t0, 3, S_3_shape_6


S_3_shape_6:
	lw $s4, -4($sp)
	lw $t8, 1536($s4)
	lw $t9, orange_0
	bne $t8, $t9, cond_S_3_shape_6
	sw $t9, -20($sp)
	lw $t8, 1524($s4)
	lw $t9, orange_1
	sw $t9, -24($sp)
	beq $t8, $t9, move_S_3_shape_6
	b start_game
cond_S_3_shape_6:
	sw $t9, -24($sp)
	lw $t8, 1524($s4)
	bne $t8, $t9, start_game
	
	lw $t8, 1536($s4)
	lw $t9, orange_1
	sw $t9, -20($sp)
	beq $t8, $t9, move_S_3_shape_6
	b start_game

move_S_3_shape_6:
	addi $t7, $s4, 756
	sw $t7, -4($sp)
	jal restore
	
	lw $t8, -24($sp)
	sw $t8, -20($sp)
	addi $t7, $t7, 768
	sw $t7, -4($sp)
	jal build_block
	
